import React, { Component } from 'react';
import Button from '@material-ui/core/Button';
class Buttonsrow extends Component {



    render() {

        return (

<div>
<p> ({this.props.customer.name}) </p>
            <div className={this.props.displayIfLoggedOut}>
                <Button type="submit" id="login" onClick={() => this.props.buttonHandlerFunction("login")} variant="contained" color="primary">Login</Button>
           </div>

<div className={this.props.displayIfLoggedIn}>Hello Simon
</div>
<div className={this.props.displayIfLoggedIn}>
                <Button type="submit" id="logout" onClick={() => this.props.buttonHandlerFunction("logout")} variant="contained" color="primary">Logout {this.props.customer.name}</Button>
            </div>

</div>
        )
    }
}
export default Buttonsrow;
